Let's open with a question: is &str a type? When not being pedantic or formal, pretty much everyone will say yes, &str is a type. However, it is technically a type constructor which is parameterized with a generic lifetime parameter. So &str isn't technically a type, &'a str for some concrete lifetime is a type. Similarly, Vec<T> for a generic T is a type constructor, but Vec<i32> is a type. By "concrete lifetime", I mean some compile-time determined lifetime. The exact definition of "lifetime" is surprisingly complicated and beyond the scope of this guide, but here are a few examples of &strs and their concrete types. // The exact lifetime of `'a` is determined at each call site. We'll explore
// what this means in more depth later.
//
// The lifetime of `b` works the same, we just didn't give it a name.
fn example<'a>(a: &'a str, b: &str) { // Literal strings are `&'static str` let s = "literal"; // The lifetime of local borrows are determined by compiler analysis // and have no names (but it's still a single lifetime). let local = String::new(); let borrow = local.as_str(); // These are the same and they just tell the compiler to infer the // lifetime. In this small example that means the same thing as not // having a type annotation at all. let borrow: &str = local.as_str(); let borrow: &'_ str = local.as_str();
}

103.body:
The most likely scenario to run into an error about dyn Trait lifetime is when Box or similar is involved, resulting an implicit 'static constraint. Those errors can often be addressed by either adding an explicit 'static bound, or by overriding the implicit 'static lifetime. In particular, using '_ will usually result in the "normal" (non-dyn Trait) lifetime elision for the given context. trait Trait {}
impl<T: Trait> Trait for &T {} // Remove `+ 'static` to see an error
fn with_explicit_bound<'a, T: Trait + 'static> (t: T) -> Box<dyn Trait> { Box::new(t)
} // Remove `+ 'a` (in either position) to see an error
fn with_nonstatic_box<'a, T: Trait + 'a>(t: T) -> Box<dyn Trait + 'a> { Box::new(t)
} // Remove `+ '_` to see an error
fn with_fn_lifetime_elision(t: &impl Trait) -> Box<dyn Trait + '_> { Box::new(t)
} This can be particularly confusing within a function body, where a Box<dyn Trait> variable annotation acts differently from a Box<dyn Trait> function input parameter annotation: # trait Trait {}
# impl Trait for &i32 {}
// In this context, the elided lifetime is `'static`
fn requires_static(_: Box<dyn Trait>) {} fn example() { let local = 0; // In this context, the annotation means `Box<dyn Trait + '_>`! // That is why it can compile on it's own, with the local reference. let bx: Box<dyn Trait> = Box::new(&local); // So despite using the same syntax, this call cannot compile. // Uncomment it to see the compilation error. // requires_static(bx);
}

104.body:
The dyn Trait lifetime elision applies in impl headers, which can lead to implementations being less general than possible or desired: trait Trait {}
trait Two {} impl Two for Box<dyn Trait> {}
impl Two for &dyn Trait {} Two is implemented for Box<dyn Trait + 'static> &'a (dyn Trait + 'a) for any 'a (the lifetimes must match) Consider using implementations like the following if possible, as they are more general: # trait Trait {}
# trait Two {}
// Implemented for all lifetimes
impl Two for Box<dyn Trait + '_> {} // Implemented for all lifetimes such that the inner lifetime is
// at least as long as the outer lifetime
impl Two for &(dyn Trait + '_) {}

105.body:
Similar to impl headers, elision will apply when defining a type alias: trait MyTraitICouldNotThinkOfAShortNameFor {} // This is an alias to `dyn ... + 'static`!
type MyDyn = dyn MyTraitICouldNotThinkOfAShortNameFor; // The default does not "override" the type alias and thus
// requires the trait object lifetime to be `'static`
fn foo(_: &MyDyn) {} // As per the `dyn` elision rules, this requires the trait
// object lifetime to be the same as the reference...
fn bar(d: &dyn MyTraitICouldNotThinkOfAShortNameFor) { // ...and thus this fails as the lifetime cannot be extended foo(d);
} More generally, elision does not "penetrate" or alter type aliases. This includes the Self alias within implementation blocks. trait Trait {} impl dyn Trait { // Error: requires `T: 'static` fn f<T: Trait>(t: &T) -> &Self { t }
} impl<'a> dyn Trait + 'a { // Error: requires `T: 'a` fn g<T: Trait>(t: &T) -> &Self { t }
} See also how type aliases with parameters behave.

106.body:
When the trait itself is 'static, the trait object lifetime has an implied 'static bound. Therefore if you name the trait object lifetime explicitly, the name you give it will also have an implied 'static bound. So here: # use core::any::Any;
// n.b. trait `Any` has a `'static` bound
fn example<'a>(_: &'a (dyn Any + 'a)) {} fn main() { let local = (); example(&local);
} We get an error that the borrow of local must be 'static. The problem is that 'a in example has inherited the 'static bound ('a: 'static), and we also gave the outer reference the lifetime of 'a. This is a case where we don't actually want them to be the same. The most ergonomic solution is to always completely elide the trait object lifetime when the trait itself has a 'static bound. Unlike other cases, the trait object lifetime is independent of the outer reference lifetime when the trait itself has a 'static bound, so this compiles: # use core::any::Any;
// This is `&'a (dyn Any + 'static)` and `'a` doesn't have to be `'static`
fn example(_: &dyn Any) {} fn main() { let local = (); example(&local);
} Any is the most common trait with a 'static bound, i.e. the most likely reason for you to encounter this scenario.

107.body:
In some contexts like when declaring a static, it's possible to elide the lifetime of types like references; doing so will result in 'static being used for the elided lifetime: // The elided lifetime is `'static`
static S: &str = "";
const C: &str = ""; As a result, elided dyn Trait lifetimes will by default also be 'static, matching the inferred lifetime of the reference. In contrast, this fails due to the outer lifetime being 'static: # trait Trait {}
# impl Trait for () {}
struct S<'a: 'b, 'b>(&'b &'a str);
impl<'a: 'b, 'b> S<'a, 'b> { const T: &(dyn Trait + 'a) = &();
} In this context, eliding all the lifetimes is again usually what you want.

109.body:
When you declare a custom type with a lifetime parameter 'a and a trait parameter T: ?Sized, including an explicit T: 'a bound will result in elision behaving the same as it does for references &'a T and for std types like Ref<'a, T>: // When `T` is replaced by `dyn Trait` with an elided lifetime, the elided lifetime
// will default to `'a` outside of function bodies
struct ExplicitOutlives<'a, T: 'a + ?Sized>(&'a T); If your type has no lifetime parameter, or if there is no bound between the type parameter and the lifetime parameter, the default for elided dyn Trait lifetimes will be 'static, like it is for Box<T>. This is true even if there is an implied T: 'a bound. For example: trait Trait {}
impl Trait for () {} // There's an *implied* `T: 'a` bound due to the `&'a T` field (RFC 2093)
struct InferredOutlivesOnly<'a, T: ?Sized>(&'a T); // Yet this function expects an `InferredOutlivesOnly<'a, dyn Trait + 'static>`
fn example<'a>(ioo: InferredOutlivesOnly<'a, dyn Trait>) {} // Thus this fails to compile
fn attempt<'a>(ioo: InferredOutlivesOnly<'a, dyn Trait + 'a>) { example(ioo);
} If you make T: 'a explicit in the definition of the struct, the example will compile. If T: 'a is an inferred bound of your type, and T: ?Sized, I recommend including the explicit T: 'a bound.

110.body:
If you have more than one lifetime bound in your type definition, the bound is considered ambiguous, even if one of the lifetimes is 'static (or more generally, even if one lifetime is known to outlive the other). Such structs are rare, but if you have one, you usually must be explicit about the dyn Trait lifetime: # trait Trait {}
# impl Trait for () {}
struct S<'a, 'b: 'a, T: 'a + 'b + ?Sized>(&'a &'b T); // error[E0228]: the lifetime bound for this object type cannot be deduced
// from context; please supply an explicit bound
const C: S<dyn Trait> = S(&&()); However, in function bodies, the lifetime is still inferred; moreover it is inferred independent of any annotation of the lifetime types: # trait Trait {}
# impl Trait for () {}
struct Weird<'a, 'b, T: 'a + 'b + ?Sized>(&'a T, &'b T); fn example<'a, 'b>() { // Either of `dyn Trait + 'a` or `dyn Trait + 'b` is an error, // so the `dyn Trait` lifetime must be inferred independently // from `'a` and `'b` let _: Weird<'a, 'b, dyn Trait> = Weird(&(), &());
} (This is contrary to the documentation in the reference, and ironically more flexible than non-ambiguous types. In this particular example, the lifetime will be inferred analogously to the lifetime intersection mentioned previously. )

111.body:
When you use a type alias, the bounds between lifetime parameters and type parameters on the type alias determine how dyn Trait lifetime elision behaves, overriding the bounds on the aliased type (be they stronger or weaker). # trait Trait {}
// Without the `T: 'a` bound, the default trait object lifetime
// for this alias is `'static`
type MyRef<'a, T> = &'a T; // So this compiles
fn foo(mr: MyRef<'_, dyn Trait>) -> &(dyn Trait + 'static) { mr
} // With the `T: 'a` bound, the default trait object lifetime for
// this alias is the lifetime parameter
type MyOtherRef<'a, T: 'a> = MyRef<'a, T>; // So this does not compile
fn bar(mr: MyOtherRef<'_, dyn Trait>) -> &(dyn Trait + 'static) { mr
} See issue 100270. This is undocumented.

112.body:
dyn Trait lifetime elision applies in this context. There are some things of note, however: Bounds on associated types and GATs don't seem to have any effect Eliding non-dyn Trait lifetimes is not allowed For example: # trait Trait {}
trait Assoc { type T: ?Sized;
} impl Assoc for () { // dyn Trait + 'static type T = dyn Trait;
} impl<'a> Assoc for &'a str { // &'a (dyn Trait + 'a) type T = &'a dyn Trait; // This is a compilation error as the reference lifetime is elided // type T = &dyn Trait;
} # trait Trait {}
# impl Trait for () {}
trait BoundedAssoc<'x> { type BA: 'x + ?Sized;
} // Still `dyn Trait + 'static`
impl<'x> BoundedAssoc<'x> for () { type BA = dyn Trait;
} // Fails as `'a` might not be `'static`
fn bib<'a>(obj: Box<dyn Trait + 'a>) { let obj: Box< <() as BoundedAssoc<'a>>::BA > = obj;
}

113.body:
There is also an exception to the elided dyn Trait lifetime being inferred in function bodies. If you have a reference-like type, and you annotate the lifetime of the non-dyn Trait lifetime with a named lifetime, then the elided dyn Trait lifetime will be the same as the annotated lifetime (similar to how things behave outside of a function body): trait Trait {}
impl Trait for () {} fn example<'a>(arg: &'a ()) { let dt: &'a dyn Trait = arg; // fails let _: &(dyn Trait + 'static) = dt;
} According to the reference, &dyn Trait should always behave like this. However, if the outer lifetime is elided or if '_ is used for the outer lifetime, the dyn Trait lifetime is inferred independently of the reference lifetime: # trait Trait {}
# impl Trait for () {}
fn example() { let local = (); // The outer reference lifetime cannot be `'static`... let obj: &dyn Trait = &local; // Yet the `dyn Trait` lifetime is! let _: &(dyn Trait + 'static) = obj;
} This is not documented anywhere and is in conflict with the reference. It was implemented here, with no team input or FCP. 🤷 However, the chances that you will run into a problem due to this behavior is low, as it's rare to annotate lifetimes within a function body.

119.body:
According to the reference, the default trait object lifetime for a trait with a single lifetime bound in the context of a generic struct with no lifetime bounds is always the lifetime in the trait's bound. That's a mouthful, but the implication is that here: trait Single<'a>: 'a {} The elided lifetime of Box<dyn Single<'a>> is always 'a. However, this is not actually the case: #trait Single<'a>: 'a {}
// The elided lifetime was `'static`, not `'a`, so this compiles
fn foo<'a>(s: Box<dyn Single<'a>>) { let s: Box<dyn Single<'a> + 'static> = s;
} #trait Single<'a>: 'a {}
// In this case it *is* `'a`, so compilation fails
fn bar<'a: 'a>(s: Box<dyn Single<'a>>) { let s: Box<dyn Single<'a> + 'static> = s;
}

120.body:
According to the reference, bounds on the trait never override bounds on the struct. But based on my testing, the opposite is true: when bounds on the trait apply, they always override the bounds on the struct. The complicated part is figuring out when they apply. For example, the following compiles, but according to the reference it should be ambiguous due to the multiple lifetime bounds on the struct. It does not compile without the lifetime bound on the trait; the bound on the trait is overriding the ambiguous bounds on the struct. use core::marker::PhantomData; // Remove `: 'a` to see the compile error
pub trait LifetimeTrait<'a>: 'a {} pub struct Over<'a, T: 'a + 'static + ?Sized>(&'a T); pub struct Invariant<T: ?Sized>(*mut PhantomData<T>);
unsafe impl<T: ?Sized> Sync for Invariant<T> {} pub static OS: Invariant<Over<'_, dyn LifetimeTrait>> = Invariant(std::ptr::null_mut()); Further below are some examples where the trait bound overrides the &_ bounds as well, so it is not just ambiguous struct bounds which can be overridden by trait bounds.

121.body:
The following is considered ambiguous due to the multiple lifetime bounds on the trait. trait Double<'a, 'b>: 'a + 'b {}
fn f<'a, 'b, T: Double<'a, 'b> + 'static>(t: T) { let bx: Box<dyn Double<'a, 'b>> = Box::new(t); // This version works: let bx: Box<dyn Double<'a, 'b> + 'static> = Box::new(t);
} The current documentation is silent on this point, but a multiple-bound trait can still apply in such a way that it provides the default trait object lifetime. pub trait Double<'a, 'b>: 'a + 'b {} fn x1<'a: 'a, 'b>(bx: Box<dyn Double<'a, 'b>>) { // This fails (the lifetime is not `'static`) //let bx: Box<dyn Double<'a, 'b> + 'static> = bx; // This also fails (the lifetime is not `'b` nor `'a + 'b`) //let bx: Box<dyn Double<'a, 'b> + 'b> = bx; // But this succeeds and we can conclude the lifetime is `'a` let bx: Box<dyn Double<'a, 'b> + 'a> = bx;
} There's a subtle point here: the elided trait object lifetime is 'a, but there's an implied : 'a + 'b bound on the trait object lifetime due to the trait bounds. Therefore the function signature has an implied 'a: 'b bound, similar to when you have a &'b &'a _ argument.

124.body:
This appears to be the most complex and arbitrary context for trait object lifetime elision. If you were paying close attention, you may have noticed that we occasionally had trivial bounds like 'a: 'a in the examples above, and that affected whether the trait bounds applied or not. A lifetime parameter of a function with no explicit bounds is known as a late-bound parameter, and whether or not a lifetime is late-bound influences when the trait bounds apply in function signatures. Parameters which are not late-bound are early-bound. Let us call a lifetime parameter of a trait which is also a bound of the trait a "bounding parameter". My hypothesis on the behavior is as follows: if any trait bound is 'static, the default lifetime is 'static if any bounding parameter is explicitly 'static, the default lifetime is 'static if exactly one bounding parameter is early-bound, the default lifetime is that lifetime including if it is in multiple positions, such as dyn Double<'a, 'a> if more than one bounding parameter is early-bound, the default lifetime is ambiguous if no bounding parameters are early-bound, the default lifetime depends on the struct bounds (the same as they do for a trait without bounds) Note that in any case, the implied bounds on the trait object lifetime that exist due to the trait bounds are still in effect. The requirement that exactly one of the bounding parameters is early-bound or that any of them are 'static are syntactical requirements, rather than semantic ones. For example: pub trait Double<'a, 'b>: 'a + 'b {} // Semantically, `'a` and `'b` must be `'static`. However the
// parameters were not explicitly `'static` and thus this
// trait object lifetime is considered ambiguous (even though,
// due to the implied bounds, it must be `'static` too).
fn foo<'a: 'static, 'b: 'static>(d: Box<dyn Double<'a, 'b>>) {} // Semantically, `'a` and `'b` must be the same. They are also
// early-bound parameters due to the bounds. However the parameters
// are not syntatically the same lifetime and thus this trait
// object lifetime is considered ambiguous.
fn bar<'a: 'b, 'b: 'a>(d: &dyn Double<'a, 'b>) {} But if you change either example to Double<'a, 'a>, then exactly one of the bounding parameters is early-bound, and they will compile: #pub trait Double<'a, 'b>: 'a + 'b {}
fn foo<'a: 'static, 'b: 'static>(d: Box<dyn Double<'a, 'a>>) {}
fn bar<'a: 'b, 'b: 'a>(d: &dyn Double<'a, 'a>) {} Implicit bounds do not negate being late-bound Note that when considering &dyn Trait there is always an implied bound between the outer reference's lifetime and the dyn Trait (in addition to the implied bound from the trait itself). However, these implied bounds are not enough to make the trait bound apply on their own. A lifetime can be late-bound even when there are implied bounds. pub trait LifetimeTrait<'a>: 'a {}
impl LifetimeTrait<'_> for () {} // All of these compile with the `fp` function below, indicating that
// the trait bound does in fact apply and results in a trait object
// lifetime independent of the reference lifetime
pub fn f<'a: 'a>(_: &dyn LifetimeTrait<'a>) {}
//pub fn f<'a: 'a>(_: &'_ dyn LifetimeTrait<'a>) {}
//pub fn f<'r, 'a: 'a>(_: &'r dyn LifetimeTrait<'a>) {}
//pub fn f<'r: 'r, 'a: 'a>(_: &'r dyn LifetimeTrait<'a>) {}
//pub fn f<'r, 'a: 'r + 'a>(_: &'r dyn LifetimeTrait<'a>) {}
//pub fn f<'r: 'r, 'a: 'r>(_: &'r dyn LifetimeTrait<'a>) {} // However none of these compile with `fp`, indicating that the elided trait
// object lifetime is defaulting to the reference lifetime "per normal".
//pub fn f(_: &dyn LifetimeTrait) {}
//pub fn f(_: &'_ dyn LifetimeTrait) {}
//pub fn f<'r>(_: &'r dyn LifetimeTrait) {}
//pub fn f<'r: 'r>(_: &'r dyn LifetimeTrait) {} //pub fn f(_: &dyn LifetimeTrait<'_>) {}
//pub fn f(_: &'_ dyn LifetimeTrait<'_>) {}
//pub fn f<'r>(_: &'r dyn LifetimeTrait<'_>) {}
//pub fn f<'r: 'r>(_: &'r dyn LifetimeTrait<'_>) {} //pub fn f<'a>(_: &dyn LifetimeTrait<'a>) {}
//pub fn f<'a>(_: &'_ dyn LifetimeTrait<'a>) {}
//pub fn f<'r, 'a>(_: &'r dyn LifetimeTrait<'a>) {}
//pub fn f<'r: 'r, 'a>(_: &'r dyn LifetimeTrait<'a>) {} // n.b. `'a` is invariant due to being a trait parameter
fn fp<'a>(t: &(dyn LifetimeTrait<'a> + 'a)) { f(t);
} The above examples also demonstrate that when trait bounds apply, they do override non-ambiguous struct bounds (such as those of &_). Implied bounds and default object bounds interact The interaction between what the default object lifetime is for a given signature can interact in potentially surprising ways. Consider this example: #pub trait LifetimeTrait<'a>: 'a {}
// The implied bounds in `&'outer (dyn Lifetime<'param> + 'trait)` are:
// - `'param: 'outer` (validity of the reference)
// - `'trait: 'outer` (validity of the reference)
// - `'trait: 'param` (from the trait bound)
//
// And as the trait bound does not apply to the elided parameter in this
// case, we also have `'outer = 'trait` due to the "normal" default
// lifetime behavior of `&_`. Adding that equality to the above bounds
// results in a requirement that *all three lifetimes are the same*.
//
// And thus this compiles:
pub fn g<'r, 'a>(d: &'r dyn LifetimeTrait<'a>) { let r: [&'r (); 1] = [&()]; let a: [&'a (); 1] = [&()]; let _: [&'a (); 1] = r; let _: [&'r (); 1] = a; let _: &'r (dyn LifetimeTrait<'r> + 'r) = d; let _: &'a (dyn LifetimeTrait<'a> + 'a) = d;
} The results can be even more surprising with more complex bounds: trait Double<'a, 'b>: 'a + 'b {} fn h<'a, 'b, T>(bx: Box<dyn Double<'a, 'b>>, t: &'a T)
where &'a T: Send, // this makes `'a` early-bound
{ // `bx` is `Box<dyn Double<'a, 'b> + 'a>` as per the rules above, // so this does not compile: //let _: Box<dyn Double<'a, 'b> + 'static> = bx; // However, the implied bounds still apply, which means: // - `'a: 'a + 'b` // - So `'a: 'b` // // Which is why this can compile even though that bound // is not declared anywhere! let t: &'b T = t; // The lifetimes are still not the same, so this fails let _: &'a T = t;
} The only reason that 'a: 'b is an implied bound in the above example is the interaction between the implied : 'a + 'b bound on the trait object lifetime the default trait object lifetime being 'a due to 'a being early-bound and 'b being late-bound If 'b was also early-bound, the default trait object lifetime would be ambiguous. If 'a wasn't early-bound, the default trait object lifetime would be 'static and there would be no implied 'a: 'b bound. The wildcard lifetime still introduces a fresh inference lifetime Based on my testing, using '_ will behave like typical lifetime elision, introducing a fresh inference lifetime in input position, and following the function signature elision rules in output position. Higher-ranked lifetimes are late-bound Based on my testing, for<'a> dyn Trait... lifetimes act the same as late-bound lifetimes.

125.body:
As mentioned above, trait object bounds always apply in function bodies, similar to function signatures where every lifetime is early-bound. This is true regardless of whether the lifetimes are early or late bound in the function signature. trait Single<'a>: 'a {} fn foo<'r, 'a>(bx: Box<dyn Single<'a> + 'static>, rf: &'r (dyn Single<'a> + 'static)) { // Here it is `'a`, and not `'static` nor inferred let bx: Box<dyn Single<'a>> = bx; // So this fails //let _: Box<dyn Single<'a> + 'static> = bx; // Here it is `'a`, and not the same as the reference lifetime nor inferred let a: &dyn Single<'a> = rf; // So this succeeds let _: &(dyn Single<'a> + 'a) = a; // And this fails //let _: &(dyn Single<'a> + 'static) = a; // Same behavior when the reference lifetime is explicit let a: &'r dyn Single<'a> = rf; let _: &'r (dyn Single<'a> + 'a) = a; //let _: &'r (dyn Single<'a> + 'static) = a; // This also fails, demonstrating that `'r` is not `'a` //let _: &'a &'r () = &&();
} And unlike elsewhere, using '_ in place of complete trait object lifetime elision in the function body does not restore the normal lifetime elision behavior (which would be inferring the lifetime). All three of the examples above behave identically if '_ is used. #trait Single<'a>: 'a {}
fn foo<'r, 'a>(bx: Box<dyn Single<'a> + 'static>, rf: &'r (dyn Single<'a> + 'static)) { let bx: Box<dyn Single<'a> + '_> = bx; // Fails //let _: Box<dyn Single<'a> + 'static> = bx; let a: &(dyn Single<'a> + '_) = rf; let _: &(dyn Single<'a> + 'a) = a; // Fails //let _: &(dyn Single<'a> + 'static) = a; let a: &'r (dyn Single<'a> + '_) = rf; let _: &'r (dyn Single<'a> + 'a) = a; // Fails //let _: &'r (dyn Single<'a> + 'static) = a;
} In combination with the behavior of function signatures, this can lead to some awkward situations. trait Double<'a, 'b>: 'a + 'b {} // Here in the signature, `'_` acts like "normal" and creates an
// independent lifetime for the trait object lifetime; let us call
// it `'c`. Though independent, it is related due to the implied
// bounds: `'c: 'a + 'b`
fn foo<'a, 'b>(bx: Box<dyn Double<'a, 'b> + '_>) { // Here in the body, the default trait object lifetime is // considered ambiguous, and `'_` does not override this. // // Moreover, there is no way to name `'c` since it was // elided in the signature. We could annotate this as // either `'a` or `'b`, but cannot "preserve" the full // lifetime unless we change the function signature to // give the lifetime a name. let bx: Box<dyn Double<'a, 'b> + '_> = bx;
}

126.body:
In most static contexts, any elided lifetimes (not just trait object lifetimes) default to the 'static lifetime. #use core::marker::PhantomData;
trait Single<'a>: 'a + Send + Sync {}
trait Halfie<'a, 'b>: 'a + Send + Sync {}
trait Double<'a, 'b>: 'a + 'b + Send + Sync {} static BS: PhantomData<Box<dyn Single<'_>>> = PhantomData;
static BH: PhantomData<Box<dyn Halfie<'_, '_>>> = PhantomData;
static BD: PhantomData<Box<dyn Double<'_, '_>>> = PhantomData; static S_BS: PhantomData<Box<dyn Single<'static> + 'static>> = BS;
static S_BH: PhantomData<Box<dyn Halfie<'static, 'static> + 'static>> = BH;
static S_BD: PhantomData<Box<dyn Double<'static, 'static> + 'static>> = BD; const CS: PhantomData<Box<dyn Single<'_>>> = PhantomData;
const CH: PhantomData<Box<dyn Halfie<'_, '_>>> = PhantomData;
const CD: PhantomData<Box<dyn Double<'_, '_>>> = PhantomData; const S_CS: PhantomData<Box<dyn Single<'static> + 'static>> = CS;
const S_CH: PhantomData<Box<dyn Halfie<'static, 'static> + 'static>> = CH;
const S_CD: PhantomData<Box<dyn Double<'static, 'static> + 'static>> = CD; However, from Rust 1.64 forward, associated consts were allowed to use general elided lifetimes and the wildcard lifetime (as opposed to only elided trait object lifetimes). This was an accidental stabilization which will probably be removed or modified. In the meanwhile, elided lifetimes act like independent lifetime variables on the impl block. Those in turn act like early-bound lifetimes in function signatures. #use core::marker::PhantomData;
#trait Single<'a>: 'a + Send + Sync {}
struct L<'l, 'm>(&'l str, &'m str);
impl<'a, 'b> L<'a, 'b> { const CS: PhantomData<Box<dyn Single<'a>>> = PhantomData; // Fails //const S_CS: PhantomData<Box<dyn Single<'a> + 'static>> = Self::CS; const S_CS: PhantomData<Box<dyn Single<'a> + 'a>> = Self::CS;
} Elided lifetimes can be inferred to be 'static elsewhere... #use core::marker::PhantomData;
#trait Single<'a>: 'a + Send + Sync {}
#struct L<'l, 'm>(&'l str, &'m str);
impl<'a, 'b> L<'a, 'b> { const ECS: PhantomData<Box<dyn Single<'_>>> = PhantomData; const SCS: PhantomData<Box<dyn Single<'static>>> = PhantomData; const S_ECS: PhantomData<Box<dyn Single<'static> + 'static>> = Self::ECS; const S_SCS: PhantomData<Box<dyn Single<'static> + 'static>> = Self::SCS;
} ...however, it's really a free variable. Therefore, cases such as this are considered ambiguous: #use core::marker::PhantomData;
