When we talk about argument position impl Trait, aka APIT, we're talking about functions such as this: # use std::fmt::Display;
fn foo(d: impl Display) { println!("{d}"); }
// APIT: ^^^^^^^^^^^^ That is, impl Trait as an argument type of a function. APIT is, so far at least, mostly the same as a generic parameter: # use std::fmt::Display;
fn foo<D: Display>(d: D) { println!("{d}"); } The main difference is that generics allow the function writer to refer to D e.g. D::to_string(&d) other utilizers to turbofish the function e.g. let function_pointer = foo::<String>; Whereas the impl Display parameter is not nameable inside nor outside the function. There may be more differences in the future, but for now at least, generics are the more flexible and thus superior form -- unless you have a burning hatred against the <...> syntax, anyway. At any rate, comparing dyn Trait against APIT is essentially the same as comparing dyn Trait against a function with a generic type parameter.

