Here, we're talking about choosing between signatures like so: # trait Trait {}
// Owned or borrowed generics
fn foo1<T: Trait>(t: T) {}
fn bar1<T: Trait + ?Sized>(t: &T) {} // Owned or borrowed `dyn Trait`
fn foo2(t: Box<dyn Trait + '_>) {}
fn bar2(t: &dyn Trait) {} When a function has a generic parameter, the parameter is monomorphized for every concrete type which is used to call the function (after lifetime erasure). That is, every type the parameter takes on results in a distinct function in the compiled code. (Some of the resulting functions may be eliminated or combined by optimization if possible). There could be many copies of foo1 and bar1, depending on how it's called. But (after lifetime erasure), dyn Trait is a singular concrete type. There will only be one copy of foo2 and bar2. Yet in your typical Rust program, generic arguments are preferred over dyn Trait arguments. Why is that? There are a number of reasons: Each monomorphized function can typically be optimized better Trait bounds are more general than dyn Trait No dyn safety concerns (T: Clone is possible) No single trait restriction (T: Trait1 + Trait2 is allowed) Less indirection through dynamic dispatch No need for boxing in the owned case Box isn't even available in #![no_std] programs The dyn Trait versions do have the following advantages: Smaller code size Faster code generation Do not make traits dyn-unsafe In general, you should prefer generics unless you have a specific reason to opt for dyn Trait in argument position.

