When we talk about return position impl Trait, aka RPIT, we're talking about functions such as this: // RPIT: vvvvvvvvvvvvvvvvvvvvvvv
fn foo<T>(v: Vec<T>) -> impl Iterator<Item = T> { v.into_iter().inspect(|t| println!("{t:p}"))
} Unlike APIT, RPITs are not the same as a generic type parameter. They are instead opaque type aliases or opaque type alias constructors. In the above example, the RPIT is an opaque type alias constructor which depends on the input type parameter of the function (T). For every concrete T, the RPIT is also an alias of a singular concrete type. The function body and the compiler still know what the concrete type is, but that is opaque to the caller and other code. Instead, the only ways you can use the type are those which are compatible with the trait or traits in the impl Trait, plus any auto traits which the concrete type happens to implement. The singular part is key: the following code does not compile because it is trying to return two distinct types. Rust is strictly and statically typed, so this is not possible -- the opacity of the RPIT does not and cannot change that. # use std::fmt::Display;
fn foo(b: bool) -> impl Display { if b { 0 } else { "hi!" }
} type alias impl Trait, or TAIT, is a generalization of RPIT which is not yet stable, but may become stable before too much longer. TAIT allows one to define aliases for opaque types, which allows them to be named and to be used in more than one location. #![feature(type_alias_impl_trait)]
type MyDisplay = impl std::fmt::Display; fn foo() -> MyDisplay { "hello," }
fn bar() -> MyDisplay { " world" } Notionally (and hopefully literally), RPIT desugars to a TAIT in a manner similar to this: #![feature(type_alias_impl_trait)]
# use std::fmt::Display;
fn foo1() -> impl Display { "hi" } // Same thing... or so
type __Unnameable_Tait = impl Display;
fn foo2() -> __Unnameable_Tait { "hi" } TAITs must still be an alias of a singular, concrete type.

