let _: Box<dyn Foo + Bar> = todo!(); However, the methods of a supertrait are available to the subtrait. What's a supertrait? A supertrait is a trait bound on Self in the definition of the subtrait, like so: # trait Foo { fn foo(&self) {} }
# trait Bar { fn bar(&self) {} }
trait Subtrait: Foo
// ^^^^^^^^^^^^^ A supertrait bound
where Self: Bar,
// ^^^^^^^^^ Another one
{} The supertrait bound is implied everywhere the subtrait bound is present, and the methods of the supertrait are always available on implementors of the subtrait. Using these relationships, you can support something analogous to dyn Foo + Bar by using dyn Subtrait. # trait Foo { fn foo(&self) {} }
