The general idea is that we're going to have a comparison trait, DynCompare, and then implement PartialEq for dyn DynCompare in a universal manner. Then our actual trait (Trait) can have DynCompare as a supertrait, and implement PartialEq for dyn Trait by upcasting to dyn DynCompare. In the implementation for dyn DynCompare, we're going to have to (attempt to) downcast to the erased base type. For that to be available we will need to first be able to upcast from dyn DynCompare to dyn Any. As the first step, we're going to use the "supertrait we can blanket implement" pattern yet again to make a trait that can handle all of our supertrait upcasting needs. Here it is, similar to how we've done it before: use std::any::Any; trait AsDynCompare: Any { fn as_any(&self) -> &dyn Any; fn as_dyn_compare(&self) -> &dyn DynCompare;
} // Sized types only
impl<T: Any + DynCompare> AsDynCompare for T { fn as_any(&self) -> &dyn Any { self } fn as_dyn_compare(&self) -> &dyn DynCompare { self }
} trait DynCompare: AsDynCompare { fn dyn_eq(&self, other: &dyn DynCompare) -> bool;
} There's an Any: 'static bound which applies to dyn Any + '_, so all of those &dyn Any are actually &dyn Any + 'static. I have also included an Any supertrait to AsDynCompare, so the "always 'static" property holds for &dyn DynCompare as well, even though it isn't strictly necessary. This way, we don't have to worry about being flexible with the trait object lifetime at all -- it is just always 'static. The downside is that only base types that satisfy the 'static bound can be supported, so there may be niche circumstances where you don't want to include the supertrait bound. However, given that we need to upcast to dyn Any, this must mean you're pretending to be another type, which seems quite niche indeed. If you do try the non-'static route for your own use case, note that some of the implementations in this example could be made more general. Anyway, let's move on to performing cross-type equality checking: #use std::any::Any;
#
#trait AsDynCompare: Any {
# fn as_any(&self) -> &dyn Any;
# fn as_dyn_compare(&self) -> &dyn DynCompare;
#}
#
#impl<T: Any + DynCompare> AsDynCompare for T {
# fn as_any(&self) -> &dyn Any {
# self
# }
# fn as_dyn_compare(&self) -> &dyn DynCompare {
# self
# }
#}
#
#trait DynCompare: AsDynCompare {
# fn dyn_eq(&self, other: &dyn DynCompare) -> bool;
#}
impl<T: Any + PartialEq> DynCompare for T { fn dyn_eq(&self, other: &dyn DynCompare) -> bool { if let Some(other) = other.as_any().downcast_ref::<Self>() { self == other } else { false } }
} // n.b. this could be implemented in a more general way when
// the trait object lifetime is not constrained to `'static`
impl PartialEq<dyn DynCompare> for dyn DynCompare { fn eq(&self, other: &dyn DynCompare) -> bool { self.dyn_eq(other) }
} Here we've utilized our dyn Any upcasting to try and recover a parameter of our own base type, and if successful, do the actual (partial) comparison. Otherwise we say they're not equal. This allows us to implement PartialEq for dyn Compare. Then we want to wire this functionality up to our actual trait: #use std::any::Any;
