A lot of core traits are built around some sort of field projection, where the implementing type contains some other type T and you can convert a &self to a &T or &mut self to a &mut T. pub trait Deref { type Target: ?Sized; fn deref(&self) -> &Self::Target;
} pub trait Index<Idx: ?Sized> { type Output: ?Sized; fn index(&self, index: Idx) -> &Self::Output;
} pub trait AsRef<T: ?Sized> { fn as_ref(&self) -> &T;
} pub trait Borrow<Borrowed: ?Sized> { fn borrow(&self) -> &Borrowed;
} // `DerefMut`, `IndexMut`, `AsMut`, ... There's generally no way to implement these traits if the type you want to return is not contained within Self (except for returning a reference to some static value or similar, which is rarely what you want). However, sometimes you have a custom borrowing type which is not actually contained within your owning type: // We wish we could implement `Borrow<DataRef<'?>>`, but we can't
pub struct Data { first: usize, others: Vec<usize>,
} pub struct DataRef<'a> { first: usize, others: &'a [usize],
} pub struct DataMut<'a> { first: usize, others: &'a mut Vec<usize>,
} This can be problematic when interacting with libraries and data structures such as std::collections::HashSet, which rely on the Borrow trait to be able to look up entries without taking ownership. One way around this problem is to use a different library or type which is more flexible. However, it's also possible to tackle the problem with a bit of indirection and type erasure.

