For an example with a more practical bent, let's say you wanted to store a distinct value for each distinct type you may encounter, for some reason. Maybe you're storing callbacks for types which are likewise type erased, say, and the callback for a Dog would be different than that for a Cat, and you might not even have a callback for the Mouse. One way to do this would be to have a data structure that maps a TypeId to the values. A "type map", if you will: # use std::any::Any;
# use std::any::TypeId;
# use std::collections::HashMap;
pub struct TypeMap<V> { map: HashMap<TypeId, V>,
} impl<V> TypeMap<V> { pub fn insert<T: Any>(&mut self, value: V) -> Option<V> { let id = TypeId::of::<T>(); self.map.insert(id, value) } pub fn get_mut<T: Any>(&mut self) -> Option<&mut V> { self.get_mut_of(&TypeId::of::<T>()) } pub fn get_mut_of(&mut self, id: &TypeId) -> Option<&mut V> { self.map.get_mut(id) } // ...
} This could be used for the callback idea: # use std::any::Any;
# use std::any::TypeId;
# use std::collections::HashMap;
# pub struct TypeMap<V> {
# map: HashMap<TypeId, V>,
# }
# impl<V> TypeMap<V> {
# pub fn insert<T: Any>(&mut self, value: V) -> Option<V> {
# let id = TypeId::of::<T>();
# self.map.insert(id, value)
# }
# pub fn get_mut<T: Any>(&mut self) -> Option<&mut V> {
# self.get_mut_of(&TypeId::of::<T>())
# }
# pub fn get_mut_of(&mut self, id: &TypeId) -> Option<&mut V> {
# self.map.get_mut(id)
# }
# }
pub struct Visitor { map: TypeMap<Box<dyn FnMut(&dyn Any)>>,
} impl Visitor { // Because we return closures we have previously created, // we should take care to not *assume* that the parameter // in the callback is of the correct type. If we never // let our closures escape to the outside world, we could // safely assume that the parameter was, in fact, `T`. // // It would be sound to `panic` if the parameter was not // `T` even if we let the closures escape, but it would // not be sound to use the unstable `downcast_ref_unchecked` // so long as we're letting the closure escape. pub fn register<T, F>(&mut self, mut callback: F) -> Option<Box<dyn FnMut(&dyn Any)>> where T: Any, F: 'static + FnMut(&T), { let callback = Box::new(move |any: &dyn Any| { if let Some(t) = any.downcast_ref::<T>() { callback(t); } }); self.map.insert::<T>(callback) } pub fn get_callback<T: Any>(&mut self) -> Option<impl FnMut(&T) + '_> { self.map .get_mut::<T>() .map(|f| { |t: &T| f(t) }) } pub fn visit<T: Any>(&mut self, value: &T) -> bool { if let Some(mut callback) = self.get_callback::<T>() { callback(value); true } else { false } } pub fn visit_erased(&mut self, value: &dyn Any) -> bool { if let Some(callback) = self.map.get_mut_of(&value.type_id()) { callback(value); true } else { false } }
} Above we have also type erased our callback signatures, since we needed a single type for our values. This is somewhat the data structure version of erasing a trait. For whatever reason you might want to map by types, this is an existing pattern in the ecosystem.

