type HR = dyn for<'any> Look<'any> + 'static;
type ST = dyn Look<'static> + 'static; HR is a subtype of ST, but not the same type . However, they both satisfy a 'static bound: #trait Look<'s> {}
#type HR = dyn for<'any> Look<'any> + 'static;
#type ST = dyn Look<'static> + 'static;
fn assert_static<T: ?Sized + 'static>() {} assert_static::<HR>();
assert_static::<ST>(); As 'static types, they have TypeIds. As distinct types, their TypeIds are different, even though one is a subtype of the other. And this in turn means that you can't stop thinking about sub-and-super types by simply applying a 'static bound. If you need to "disable" sub/super type coercions in a generic context for soundness, you must make that context invariant or take other steps to avoid a soundness hole, even if you have a 'static bound. See this issue for a real-life example of such a soundness hole, and this comment in particular exploring the sub/super type relationships of higher-ranked function pointers.

